  - name: TEXT4000
    number: '6'
    value: 'Amended Report to clarify descriptions in response to Letter. Expenditures
      to Axiom Strategies LLC, Faulkner Strategies, The Hopper Company, On The Mark,
      and Political Ink LLC on Sch B, line 30b, represent exempt activity expenditures
      as defined in 11 CFR 100.87 and 100.147 and were distributed by volunteers.
      These expenses were not paid for with transfers in from the Republican National
      Committee or from funds designated for a particular candidate. No expenditure,
      other than a direct contribution or exempt activity so identified, was made
      on behalf of a specifically identified federal candidate. No expenditure not
      identified as such was for a public communication that referred to a clearly
      identified candidate for Federal office and that promoted, supported, attacked
      or opposed any such candidate for Federal office. All expenditures to individuals
      for rent represent rent income to those individuals and are not required to
      be itemized. Negative expense from John Thrasher on 11/17/10 for $844.10 is
      a reimbursement from him for amounts inadvertently paid by the Committees American
      Express card on the dates noted to Delta Airlines and Southwest Airlines and
      originally reported as administrative expenses. Negative expense from Colodny
      Fass Talenfeld Karlinksy Abate on 11/9/10 for $257.62 is a reimbursement from
      this firm for an amount inadvertently paid by the Committees American Express
      card on 9/24/10 to Walt Disney World Contemporary Resort and originally reported
      as a fundraising activity for the MD-10B event. All disbursements for salaries
      and benefits disclosed on Schedule H4 are for employees who did not spend more
      than 25% of their compensated time during the reporting period on Fed election
      activities or activities in connection with a Federal election. All transfers
      for allocated activity reported on Sch H3 occurred within the 70-day permitted
      window of time. The Committee uses the Escrow option for receipt of corporate
      in-kind donations as provided for by the Commission in Advisory Opinion 1992-33.
      The method ensures that prohibited sources are not used to fund the federal
      share of allocable activity expenses. In-kind details and the escrow account
      activity are summarized as follows:   Admin Acct: 10/14/10 Admin escrow balance
      $658.43  11/1/10 transfer to Admin escrow account of $840  11/4/10 Yuma Solutions
      in-kind of $4,000 as reflected on Sch H4 and transfer on Sch H3 using $840 of
      escrow balance.  11/22/10 Admin escrow balance of $658.43  10/14/10 and 11/22/10
      MD-10B escrow account balance is $6,010.33.  COMBINED ESCROW BALANCE OF $6,668.76.  '
  - value: '

'
